n\\"];\\n    this.parsed = {}\\n    for(i=0;i<this.data.length;i++) {\\n      this.parsed[this.data[i].country.toUpperCase()] = this.data[i].value;\\n    }\\n    d3.json(this.codemapfile.datauri, function(codemap) {\\n    d3.json(that.countryfile.datauri, function(ret) {\\n      var features = topojson.feature(ret, ret.objects.countries).features;\\n      for(var i=0;i<features.length;i++) {\\n        var ret = that.parsed[codemap[features[i].id]];\\n        if(typeof(ret)!=\\"undefined\\") features[i].value = ret;\\n      }\\n      that.valuerange = d3.extent(features.map(function(it) { return it.value; }));\\n      that.countries = features;\\n      that.svg.selectAll(\\"path.country\\").data(features)\\n        .enter().append(\\"path\\").attr({class: \\"country\\"})\\n        .on(\\"mouseover\\", function(it) {\\n          that.active = it;\\n          it.x = d3.event.clientX;\\n          it.y = d3.event.clientY;\\n          that.render();\\n        });\\n      that.svg.selectAll(\\"text.country\\").data(features)\\n        .enter().append(\\"text\\").attr({class: \\"country\\"}).\\n        text(function(it) {\\n          return(codemap[it.id] || \\"UNKNOWN\\");\\n      });\\n      that.resize();\\n      that.render();\\n    });\\n    });\\n  },\\n  bind: function() {\\n  },\\n  resize: function() {\\n    var that = this;\\n    var box = this.root.getBoundingClientRect();\\n    var svgbox = this.svgbox = d3.select(this.root).select(\\"svg\\")[0][0].getBoundingClientRect();\\n    var width = this.width = box.width;\\n    var height = this.height = box.height - 10 - svgbox.top;\\n    \\n    this.svg.attr({\\n      width: width + \\"px\\", height: height + \\"px\\",\\n      viewBox: [0,0,width,height].join(\\" \\"),\\n      preserveAspectRatio: \\"xMidYMid\\"\\n    });\\n    this.projection = d3.geo.mercator().translate([width/2, height * 0.7]);\\n    this.path = d3.geo.path().projection(function(coord) {\\n      coord[0] = coord[0] - 11.5;\\n      coord = that.pro