e;\\n      ni.y = ni.y + (this.height / 2 - ni.y) * rate;\\n      if(ni.y + ni.r >= this.height - this.config.margin) ni.y -= 1;\\n      if(ni.y - ni.r <= this.config.margin) ni.y += 1;\\n    }\\n    for(var i=0; i<this.nodes.length;i++) {\\n      for(var j=0;j<this.nodes.length;j++) {\\n        if(i==j) continue;\\n        ni = this.nodes[i];\\n        nj = this.nodes[j];\\n        r = ni.r + nj.r;\\n        dx = ni.x - nj.x;\\n        dy = ni.y - nj.y;\\n        d = Math.sqrt(dx * dx + dy * dy);\\n        if(r < d) continue;\\n        dr = (r - d) / ( d * 1000);\\n        ni.x = ni.x + dx * dr;\\n        ni.y = ni.y + dy * dr;\\n        nj.x = nj.x - dx * dr;\\n        nj.y = nj.y - dy * dr;\\n      }\\n    }\\n    this.render();\\n    if(this.force.alpha()<0.011) this.force.alpha(0.012);\\n  },\\n  render: function() {\\n    var that = this;\\n    this.lineGroup.selectAll(\\"g.data\\").attr({\\n      transform: function(it) {\\n        return [\\"translate(\\",it.x,\\",\\",it.y,\\")\\"].join(\\"\\");\\n      }\\n    }).each(function(d,i) {\\n      var node = d3.select(this);\\n      if(d.parent) node.select(\\"line\\").attr({\\n        x1: 0, x2: d.parent.x - d.x,\\n        y1: 0, y2: d.parent.y - d.y,\\n        stroke: \\"#000\\"\\n      });\\n    });\\n    this.circleGroup.selectAll(\\"g.data\\").attr({\\n      transform: function(it) {\\n        return [\\"translate(\\",it.x,\\",\\",it.y,\\")\\"].join(\\"\\");\\n      }\\n    }).each(function(d,i) {\\n      var node = d3.select(this);\\n      node.select(\\"circle\\").attr({\\n        cx: 0, cy: 0, r: function(it) { return it.r / (it.values?it.values.length || 1:1); },\\n        fill: function(it) { return that.color(it.key || it.category); },\\n        stroke: \\"none\\"\\n      });\\n      node.select(\\"text.label\\").attr({\\n        \\"text-anchor\\": \\"middle\\",\\n        \\"dominant-baseline\\": \\"central\\",\\n        fill: function(it) {\\n          var color = d3.hsl(that.color(it.key || it.category));\\n          if(color.l > 0.6) color.l = 0.1\\n          else color.l = 0.9\\n          return color.toString();\\n        },\\n        \\"font-weight\\": \\"900\\",\\n        \\"stroke-width\\": 0\\n      }).text(d.name || d.key);\\n      node.select(\\"text.shadow\\").attr({\\n        \\"text-anchor\\": \\"middle\\",\\n        \\"dominant-baseline\\": \\"central\\",\\n        stroke: function(it) {\\n          var color = d3.hsl(that.color(it.key || it.category));\\n          if(color.l < 0.6) return \\"rgba(0,0,0,1)\\"\\n          return \\"rgba(255,255,255,1)\\";\\n        },\\n        \\"font-weight\\": \\"900\\",\\n        \\"stroke-width\\": 5,\\n      }).text(d.name || d.key);\\n    });\\n    var root = this.nodes.filter(function(it) { return !it.parent; });\\n    this.title.attr({\\n      x: root[0].x,\\n      y: root[0].y,\\n      \\"text-anchor\\": \\"middle\\",\\n      \\"dominant-baseline\\": \\"central\\",\\n      \\"font-size\\": 25,\\n      fill: function() {\\n        it = root[0];\\n        var color = d3.hsl(that.color(it.key || it.category));\\n        if(color.l > 0.6) color.l = 0.1\\n        else color.l = 0.9\\n        return color.toString();\\n      },\\n    }).text(this.config.title);\\n  }\\n});"}	{"value": [{"perm": "fork", "switch": "public"}], "switch": ["public"]}	[]	\N	\N
