ale(nj.sum);\\n        dx = ni.x - nj.x;\\n        dy = ni.y - nj.y;\\n        d = Math.sqrt(dx * dx + dy * dy);\\n        if(r > d) {\\n          d = (r - d) / (d * 2);\\n          ni.x = ni.x + dx * d;\\n          ni.y = ni.y + dy * d;\\n          nj.x = nj.x - dx * d;\\n          nj.y = nj.y - dy * d;\\n        }\\n      }\\n    }\\n    this.renderPie();\\n  },\\n  render: function() {\\n    var that = this;\\n    this.rootgroup.attr({\\n      transform: [\\"translate(\\",this.width / 2,\\",\\",this.height / 2,\\")\\"].join(\\"\\")\\n    });\\n    this.svg.selectAll(\\"path.county\\")\\n      .attr({\\n        \\"d\\": that.path,\\n        \\"fill\\": this.config.baseColor,\\n        \\"stroke\\": this.config.strokeColor,\\n        opacity: 1,\\n        \\"stroke-width\\": 2\\n      });\\n    this.renderPie();\\n  },\\n  renderPie: function() {\\n    var that = this;\\n    this.svg.selectAll(\\"line.connect\\").attr({\\n      x1: function(d,i) { return d.properties.c[0]; },\\n      y1: function(d,i) { return d.properties.c[1]; },\\n      x2: function(d,i) { return d.d.x; },\\n      y2: function(d,i) { return d.d.y; },\\n      stroke: d3.rgb(this.config.baseColor).darker().toString(),\\n      opacity: 0.8,\\n      \\"stroke-dasharray\\": \\"2 4\\",\\n      \\"stroke-width\\": 2\\n    });\\n    this.svg.selectAll(\\"g.data\\").attr({\\n      transform: function(d,i) {\\n        var c = d.properties.c;\\n        return [\\"translate(\\",d.d.x,\\",\\",d.d.y,\\")\\"].join(\\"\\");\\n      }\\n    });\\n    this.svg.selectAll(\\"path.pie1\\").attr({\\n      d: function(d,i) {\\n        var p = d.properties;\\n        return that.arc\\n          .startAngle(0)\\n          .endAngle(Math.PI * 2 * (p.value1 /( p.sum || 1)))\\n          .outerRadius(that.rscale(p.sum))();\\n      },\\n      fill: this.config.color1,\\n      stroke: \\"#fff\\",\\n      \\"stroke-width\\": 1.5\\n    });\\n    this.svg.selectAll(\\"path.pie2\\").attr({\\n      d: function(d,i) { \\n        va