281	83	data visualization recent user activities	server	message	\N	\N	["開源的視覺化工具有哪些，你知道嗎？ Github 列出 23 個開源的視覺化工具並按熱門度排序，除了前幾名的 D3, Chart.js 等專案你還知道哪些呢？\\n\\n網址: https://github.com/showcases/data-visualization", "若紐約的生活費是 100 ，你知道台北的生活費是多少嗎？經濟學人針對世界各地的生活開銷做了一個排名表，以類似點圖的方式呈現，有趣的是他只呈現前幾名的細節，其它城市則以類似線圖的方式表現，滑鼠移入後才展現細節。由於資料量原本就很多，在搭配搜尋功能的情況下，這樣的互動性反而增加了可讀性。", "小編年輕的時候去過一次，在退潮時分踏浪到遠方島嶼，一路上可以看到很多潮間帶的生物，當時在岸邊便可以看到政府製作的潮汐時間查詢表，然而表格在閱讀上不是很直覺，這次「關於澎湖群島」利用 Highchart 製作了視覺化的線上查詢系統，是不是看得比較清楚呢？\\n\\n「關於澎湖群島」粉絲專頁一直都有很棒的作品，有機會也希望可以跟他們合作呢！", "有時只是想畫個簡單的時間軸，可是光是排版就花了半天！別再浪費人生了，讓 Labella 替我們快速搞定排版吧！", "視覺化缺乏好工具嗎？ Keshif 整裡 385 個視覺化工具，搭配Keshif 的探索介面，讓你輕易根據自己的需求與能力來挑選最適合的視覺化工具。\\n\\nKeshif 由馬里蘭大學的 Mehmet Adil Yalcin 開發，本身亦為一個資料視覺化工具，他為我們整理與摘要資料的內容，讓我們可以更深入資料的細節來挖掘，而且是開源的！好工具，不用嗎？", "誰說視覺化一定要是單純的元素？Facebook 時間軸的設計者 Nicolas Felton 所著 PhotoViz 一書中，大量使用照片來表現與呈現資訊，例如此縮圖即以時間為維度表現同一地點晨昏之間變化的視覺表現，如果你同時又愛玩攝影，相信這本書很難不打動你的心。\\n\\nPhotoViz 一書將於 5/18 出版，在 Amazon 上可以 46.75 美金預購。準備好勒緊褲帶下單了嗎？", "我們之前與大家分享過的「Data Visualization Catalogue」網站最近似乎又紅起來了，那就讓我們再告訴大家一個秘密吧！Data Visualization Catalogue 裡的所有視覺化圖示都可以在 Noun Project 裡面找到喔！小編已經整組購買過了，雖然我們可以依 CC-BY 創用授權來使用，但若你想支持作者 Severino Ribecca 又剛好有需要，就一起以行動來支持吧！\\n\\nNoun Project 圖示網址: https://thenounproject.com/r.severino/collection/data-visualisation-catalogue-icons/", "你懂得如何分辨爛圖表與好圖表嗎？「Storytelling with Data」 一書為 Google 資料視覺化內訓講師 Cole Nussbaumer Knaflic 將其知識去蕪存菁的一個精華手冊，並已於上個月由商業周刊出版中譯本，小編已拜讀，相當值得一看！\\n\\n有別於一般從基礎與理論下手的視覺化教材，「Storytelling with Data」從功能面著手，穿插各類技巧與經典範例帶大家逐步實作，內容多有引據，讓讀者不光學會，還懂得為什麼。\\n\\n小編曾實際接觸過該課的學員，當時就很希望有機會可以一覽課程的內容，現在由講師親撰了此書還翻譯好，別錯過囉。\\n\\n( 中譯: Google 必修的圖表簡報術，譯：徐昊 )", "雖然自人類首次進入太空以來已經過了數十年，曾經到過外太空的人數還是少之又少。\\n\\n這個互動圖表利用散布圖表現所有曾進入過外太空的人類，並讓我們自由的切換各種維度，從國籍、年紀、因太空旅行延長的壽命等。\\n\\n雖然人類文明以指數等級成長，面對更大尺度的宇宙，不曉得要到什麼時候才能讓所有人都能自由的穿梭在星球之間呢？\\n\\n網址：\\nhttp://cosmos-book.github.io/human-spaceflight/index.html", "歐幾里得對畢氏定理的證明，光看文字也許讓人頭疼，但搭配上互動視覺化的圖解，是不是讓數學也生動了起來？\\n\\nVictor Powell 將證明原文中的所有符號轉變成錨點，只要將滑屬移上去，左方的圖例便會亮起對應的形狀或線段。\\n\\n網址: http://setosa.io/pythagorean/\\n\\n#解釋性探索", "你的工作跟你老爸一樣嗎？臉書分析其部份用戶的親屬、職業等資料，繪製了這個親子職業關係圖。滑鼠移上左方的父親職業區塊，右方對應的兒子職業便會被濾出，讓我們可以很快的看出親子間的職業比例。\\n\\n除此之外，臉書也分析了母女、兄弟間的職業關係，以及各種長輩職業與晚輩職業的關係圖，雖然主要以英語系國家的資料為主，仍是個很有趣的資料視覺化！\\n\\n網址: https://research.facebook.com/blog/do-jobs-run-in-families-/", "色盤挑選最終章！如何為色盲者製作色盤？顏色的語意又是什麼意思？讓我們一起來補完視覺化色盤製作的最後一環吧！", "若你對地圖視覺化有興趣，那就不能錯過牛津網路學院的「Informaton Geographies」專案。有別於以往常見的資料呈現，他們將當代的各種知識利用許多種不同的地圖視覺化來表現，比方說六角形的統計地圖、媒體關注的地理分析等等；又像是開放街圖的描繪密度除了以城市光地圖的樣式呈現，也正巧就與夜間城市光分布習習相關。\\n\\n網址: http://geography.oii.ox.ac.uk/?page=home", "今天於中研院舉行的資料視覺化課程，你在現場嗎？「資料視覺化之理論、賞析與實作」為資料科學愛好者年會系列活動，由台大康仕仲教授授課，錯過了別覺得可惜，投影片陸續釋出中，一起來看看吧！\\n\\n投影片網址: http://www.slideshare.net/tw_dsconf/ss-60041639", "如果交通費漲價，你是否會哇哇叫？Uber 透過即時調整費率來平衡供需，期望提供乘客更好的服務。但乘客也許不這麼認為 — 我們只覺得變貴了。事實究竟是如何呢？\\n\\n這個互動視覺化利用模擬來探討車資、司機與乘客間的關係，並以即時線圖表現三者的數據；除了能隨意調整叫車人數外，也可以設定不同價格下的司機人數，而伴隨互動視覺化的則是一篇相當深入的分析專文。\\n\\n人類也許還沒演化出看透大系統的腦袋，那就讓視覺化幫助我們吧！\\n\\n互動視覺化網址:\\nhttp://www.countingcalculi.com/interactives/uber_v_taxis/\\n\\n文章網址: http://www.countingcalculi.com/features/uber_v_taxis/", "D3.js 的 Force Layout 有相當多參數可調整，但往往讓人搞不懂各有什麼效果。Christopher Manning 製作了這個「Octocat  Force Layout」利用 Github 公仔與互動介面讓我們調整 Force Layout 並即時了解參數效果！就算沒有要做 Force Layout 視覺化，玩一玩也是相當療癒喔！\\n\\n網址: http://bl.ocks.org/christophermanning/4527513", "AlphaGo 打敗人類圍棋高手李世乭，歷年的圍棋冠軍是哪些人，而中國與韓國又是在什麼時候掘起的呢？\\n\\n這個視覺化影片告訴你，從 1974 年自今的世界前十強圍棋高手是誰。\\n\\n網址: https://www.youtube.com/watch?v=oRvlyEpOQ-8", "視覺化正夯！紐約市府徵求資料視覺化專家，如果熱愛視覺化的你人在紐約，可別遲疑了。視覺化相關的職位需求越來越多了，你還不好好學習視覺化嗎？\\n\\n網址: http://dataviz4nyc.github.io/", "[手稿] 設計中的視覺圖表速查表。最初覺得這方面的中文資源真的不多，因此一直有整理相關知識的想法，海報或小抄是種相當不錯的表現形式，所以就先朝這個方向來做了。\\n\\n目前還在設計的階段，希望上半年有機會實體化，也歡迎大家給小編意見喔～", "挑戰臉書泡泡，Google 這樣做！身為 Alphabet 的子公司之一，Jigsaw 以視覺化的方式搭配 Google  News 的新聞資料提供全球讀者各種「較少被報導 ( Underreport ) 的重大新聞」，並同時提供地圖與清單檢視。\\n\\n雖然人稱一出手你就 GG 的 GooGle 出手了，小編還是很支持本土的視覺化新聞平台 OORTI ，OORTI 加油！", "還不曉得顏色怎麼挑嗎？相較於理論性的上集，這次我們來看看哪些工具跟手法可以讓我們做出跟紐時圖表報導一樣讚的色盤。", "將 1850 以來的所有颱風軌跡描繪出來，並從北極做視點，結果發現了 Firefox 火狐的陰謀！", "樹木就像城市裡的肺一樣，這個視覺化分析紐約市中不同品種的樹木在各區內的累計數量。搭配堆積長條圖、山基圖與互動的效果，讓我們可以很輕易的找到我們有興趣的樹木比重，是一種很有效的組合式圖表。\\n\\n網址: http://www.cloudred.com/labprojects/nyctrees/", "需要做城市視覺化嗎？VizCities 幫你繪出立體城市地圖！VizCities 利用開放街圖、 WebGL 等技術，讓我們可以快速繪出世界各處的城市 3D 地圖，在網頁中即時瀏覽，更重要的是—他是開源軟體，在 Github 便可以找到其源碼並使用。下圖為台北101 一帶的 3D 地圖。\\n\\n即時展示: http://vizicities.apps.rawk.es/demo.html\\n源碼網址: https://github.com/vizicities/vizicities\\n ( MIT License )", "正規表達式可說是資料處理最強大的工具之一，幾乎你想得到的資料編輯工具與程式語言都有相關接口，但可惜看起來很複雜，懂的人也不多，學習與應用都頗有門檻。regexper.com 讓我們能快速拆解正規表達變成圖像片段，讓一般人更容易理解其內容。\\n\\n下圖為台灣電話號碼(手機+市話)的正規表達式，你有看懂嗎？\\n\\n網址: https://goo.gl/kImGtM"]
